import './assets/jufb-bootstrap.css';
import { React } from 'react';
import { Link, Route, Routes } from 'react-router-dom'
import { Footer } from './components/Footer';
import { Header } from './components/Header';
import { Home } from './views/home';
import { About } from './views/about';
import { Projects } from './views/portfolio/projects';
import { ProjectManagement } from './views/portfolio/project_management';

function App() {
  return (
    <div className="App">
      <Header />
        <Link exact path="/" element={<Home/>} />
        <Link exact path="/Home" element={<Home/>} />
        <Link exact path="/About" element={<About/>} />
        <Link exact path="/Projects" element={<Projects/>} />
        <Link exact path="/ProjectManagement" element={<ProjectManagement/>} />
      <Footer />
    </div>
   );
}
export default App;
